import React from 'react'
import { Container, ContainerEffect, ContainerMoviePrincipal, ContainerTitle } from './styled'

const TopCoverMovie = (props) => {

  return (

    <div>
      <ContainerTitle>
        {props.movieRandon && props.movieRandon.original_name}
      </ContainerTitle>

      <ContainerMoviePrincipal>
        {props.movieRandon && <img src={`https://image.tmdb.org/t/p/original${props.movieRandon.backdrop_path}`} />}
      </ContainerMoviePrincipal>
    </div>
    
  )
}

export default TopCoverMovie
